  `buttons` text COMMENT '功能按钮列表 json格式:\n[\n{\n	“logoUrl”:”http://xxxxxx”,\n	“type”:”1”,//0:表示跳转默认模版页，1:表示跳转web页，2：表示跳转某个功能页\n	“skip”:””//如果type为0此为json数据，如果type=1 skip是跳转的url，如果type=2 skip是跳转的页面\n},\n…\n]',
  `match_note` varchar(255) DEFAULT NULL COMMENT '比赛说明',
  `max_people_num` int(11) DEFAULT '10000' COMMENT '最大人数',
  `now_people_num` int(11) DEFAULT '0' COMMENT '当前人数',
  `creator_user_id` bigint(20) DEFAULT NULL COMMENT '创建人的ID',
  `is_need_profession` int(11) DEFAULT '0',
  `is_need_stu_class` int(11) DEFAULT '0',
  `is_need_stu_num` int(11) DEFAULT '0',
  `apply_banner` varchar(255) DEFAULT NULL COMMENT '报名页面的banner',
  `apply_banner_width` int(11) DEFAULT NULL,
  `apply_banner_height` int(11) DEFAULT NULL,
  `logo` varchar(255) DEFAULT NULL,
  `init_total_assets` varchar(255) DEFAULT NULL COMMENT '参与比赛 用户初始化的总资产',
  `leader` varchar(45) DEFAULT NULL,
  `sms_num` int(11) DEFAULT NULL COMMENT '此比赛下发送了多少短信',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

